            [description] => 【注意】抽出に時間がかかります。

CP期間中にログインしており、
最後のログインが「最後のログイン」より前のユーザーを抽出
※1個めと2個めの入力欄は同じ日付の入力でOK
            [sql_text] => select b.uid,ui.authkey,b.type,before_login_time,login_time from 
(
  select uid,type,max(log_time) as before_login_time
  from user_log 
  where
    @1
    and category='login' and type='user_login'
  group by uid,type
) as b,
(
  select uid,type,max(log_time) as login_time
  from user_log 
  where
    @2
    and category='login' and type='user_login'
  group by uid,type
) as a,
user_info as ui
where 
 b.uid=a.uid and ui.uid=a.uid and @3

