  from user_log 
  where
    @1
    and category='login' and type='user_login'
  group by uid,type
) as b,
(
  select uid,type,max(log_time) as login_time
  from user_log 
  where
    @2
    and category='login' and type='user_login'
  group by uid,type
) as a,
user_info as ui
where 
 b.uid=a.uid and ui.uid=a.uid and @3

